import image1 from './assets/image1.png'
import { FaStar } from "react-icons/fa";

class airbnbInfo {
    constructor(name, rating, country, price, available, img) {
      this.name = name;
      this.rating =  rating;
      this.country = country;
      this.price = price;
      this.available = available;
      this.img = img
    }
  }

let card1 = new airbnbInfo('Life Lessons from Zate', '5.0', 'USA', '123', 'SoldOut', image1);

function CardRender(card1) {
    return (
            <div className='card-component shadow-lg p-4 rounded mx-3 my-5'>
                <span className='soldout-text px-2 m-3'>{card1.available}</span>
                <img src={card1.img} className='card-image shadow-lg'></img>
                <span><FaStar className='star'/>{card1.rating} {card1.country}</span>
                <br></br>
                <span>{card1.name}</span>
                <br></br>
                <span><b>From {card1.price}$</b> / person</span>
            </div>
    )
}

function CardList(){
    return(
        <div>
            <CardRender/>
            <CardRender/>
            <CardRender/>
      </div>
    )
}

export {CardList};
